<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    function missingValue(A, B) {
        const result = [];

        for (let i = 0; i < B.length; i++) {
            const value = B[i];

            if (!A.includes(value)) {
                if (!result.includes(value)) {
                    result.push(value);
                }
            }
        }

        return result.sort((a, b) => a - b);
    }

    const A = [7, 2, 5, 3, 5, 3];
    const B = [7, 2, 5, 4, 6, 3, 5, 3];
    document.write(missingValue(A, B));
</script>
</body>
</html>
